DROP TABLE practicum_view;
CREATE VIEW practicum_view AS SELECT p.practicum_id AS id, u.username, s.name AS skill, c.code AS level, c.index AS level_index, u.name AS first_name, u.surname AS last_name, u.surname || ' ' || u.name AS full_name, u.position AS position, u.location AS location FROM practicum p, users u, skill s, code_table c WHERE p.user_id = u.user_id AND p.skill_id = s.skill_id AND p.level = c.code_table_id;
